import React from 'react';
import { Link } from 'react-router-dom';

function About(props) {
  return (
    <div className="about">
      <div className="containter">
        <div className="about-name"></div>
        <h1 className="name">Hi, my name is Noah.</h1>
        <h3 className="introduction">
          I am a UX/UI Designer interested in leveraging technology to make
          people&apos;s lives more efficient and happier. <br />
          <br />I have previously worked at Luxrobo, Giant Shoulders, and
          Weddell Co. to build products from scratch. I am currently looking for
          new opportunities after studying Industrial Design at Rhode Island
          School of Design.&nbsp;
          <Link to="/AboutMore" className="introduction-more">
            View More
          </Link>
        </h3>
        <button>Resume</button>
        <Link to="https://www.linkedin.com/in/noahsjung/" target="blank">
          <button type="button">Linkedin</button>
        </Link>
      </div>
    </div>
  );
}

export default About;
